import React from 'react'
import Title from './Title'
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import RoomItem from  './RoomItem'
export default function Home(props) {
    const navigate = useNavigate()

    const addRoom = () => {
        navigate('/addroom')
    }
const goToDeviceComp =() => {
    navigate('/adddevice')
}
  return (
    <div>
        {/* <a href='/adddevice'>{room.rName} */}
        <Title text={"Smart Home"}/>
        {props.rooms.map((room)=>{
            return         <button  onClick={goToDeviceComp}>{room.rName}</button>
 
            // component room item - in this component use the right css
        })}
        <span><button className='plus' onClick={addRoom}>+</button></span>
    </div>
  )
}
